import styled from 'styled-components'


const Wrapper = styled.div`
    width: 20%;
    height: 300px;
    border-radius: 10px;
    background:grey;
`;

const Img = styled.img`
    width:100%;
    height:200px;
    object-fit: cover;
`;

export default function Card({ loan }) {
    return (
        <Wrapper>
            <img src={loan.url} alt={loan.name}/>
            {loan.name}
        </Wrapper>
    )
}
